import React, { Component } from 'react';
import './universityList.css';
import UniversityCard from '../universityCard';
import { DragDropContext, Droppable } from 'react-beautiful-dnd';

function UniversityList(props) {
   const  { title, subTitle, universityArray, updateBucket } = props ;
    return <div>
        {title && <div className="marginTop">{title}</div>}
        {subTitle && <div className="marginTop">{subTitle}</div>}
        <DragDropContext>
            <Droppable droppableId="key">
                {(provided) => (
                   <ul> {universityArray && <div className="marginTop">{universityArray.map((university,index) => <UniversityCard {...university} key={index} addToBucket={() => updateBucket(university)}/>)}</div>} </ul>
                )}
            </Droppable>
        </DragDropContext>
        {universityArray && <div className="marginTop">{universityArray.map((university,index) => <UniversityCard {...university} key={index} addToBucket={() => updateBucket(university)}/>)}</div>}
    </div>

}
export default UniversityList;
